import React from 'react';
import Pexeso from '../assets/images/Pexeso'
import yPin from '../assets/images/yPin'
import Github from '../assets/images/Github'

class Carousel extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            items: [
                {
                    id: 0,
                    tittle: 'Spike The Day',
                    subtittle: 'Advertisment app that using AR technology',
                    imgSrc: yPin,
                    link: 'htttps://spike.com',
                    selected: false
                },
                {
                    id: 1,
                    tittle: 'Pexeso',
                    subtittle: 'Memory card game with different kind of animations',
                    imgSrc: Pexeso,
                    link: 'htttps://pexeso.com',
                    selected: false
                },
                {
                    id: 3,
                    tittle: 'Github',
                    subtittle: 'Personal github page',
                    imgSrc: Github,
                    link: 'https://github.com',
                    selected: false
                }
            ]
        }
    }

    render() {
        return(
           <p>Carousel Works!</p> 
        );
    }
}

export default Carousel;
